import React from "react";

const Article = () => {
  const containerStyle = {
    background: "linear-gradient(to right, #050F4E 50%, white 50%)",
  };
  return (
    <div className="flex">
      <div className="mt-16 h-[642px]" style={containerStyle}>
        <div className="h-[470px] w-[1264px] bg-white flex">
          <div className="flex flex-col">
            <h1 className="text-sm bg-[ADB3BE]">Article</h1>
            <h1 className="text-[#050F4E] text-4xl mt-4">
              The Benefits Of Digital Sequence <br /> Information In Biological
              Research.
            </h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Article;
